
public class JavaDemo11 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
        int a,b,u;
        a=23;
        b=56;
        System.out.println("Before  Swapping=a,b="+a+","+ + b);
        u=a;
        a=b;
        b=u;
        System.out.println("After Swapping=a,b"+a+","+ + b);
         
	}     

}
